import React from "react";
import "./style.css";
import {useHistory} from "react-router-dom";


const Weeks = (props) => {

    const history = useHistory();

    let day = ["일", "월", "화", "수", "목", "금", "토"]

    return (
        <div>  {/* 자바스크리트 안에서 html태그를 리턴해준 상태 -> {}안에서 자바스크립트 문법 사용 */}
            {day.map((e, i) => {
                return <div className="weeks-list">{e}
                            <div id="circle"></div>
                            <div id="arrow" onClick={() => {
                                history.push("./StarPage");
                            }}></div>
                        </div>

            })}


            {/* <div className="weeks-list">일
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div> */}

        </div>
    );
}


//만든 컴포넌트를 다른 파이에서도 불러다가 쓸 수 있도록 export해줌!
export default Weeks;
